using GenPDF.Models;
using QuestPDF.Fluent;
using QuestPDF.Infrastructure;

namespace GenPDF.Components.Eval
{
    public class EvalOverallRatingComponent : IComponent
    {
        private EvalProgModel _data;

        private byte[] no = Convert.FromBase64String(
            ""
        );
        private byte[] yes = Convert.FromBase64String(
            ""
        );

        private List<string> _titles = new List<string>()
        {
            "1) Does the patient have the cognitive ability and verbal capacity to participate and benefit from psychotherapy?",
            "2) Is treatment justified based on your assessment of the patient’s ability to perform in therapy?",
            "3) Does patient’s condition result in significant impairment in social functioning?",
            "Does patient’s condition result in significant impairment in behavioral functioning?",
            "4) Does patient’s condition result in significant impairment in psychological functioning?",
            "Does patient’s condition result in significant impairment in emotional functioning?",
            "5) Does patient’s condition interfere with compliance of recommended medical treatments or therapies?",
            "6) Will patient’s condition deteriorate if patient does not participate in psychotherapy or if treatment discontinues?",
        };
        private uint _rowCount = 0;
        private uint _padding = 0;

        public EvalOverallRatingComponent(EvalProgModel data)
        {
            _data = data;
        }

        public EvalOverallRatingComponent(EvalProgModel data, uint padding)
        {
            _data = data;
            _padding = padding;
        }

        public void Compose(IContainer container)
        {
            List<string> propList = GetProps(_data);
            container.Table(table =>
            {
                table.ColumnsDefinition(column =>
                {
                    for (int i = 0; i < 12; i++)
                    {
                        column.RelativeColumn();
                    }
                });
                //Haeder
                table
                    .Cell()
                    .Row(++_rowCount)
                    .Column(1)
                    .ColumnSpan(12)
                    .PaddingTop(_padding + 5)
                    .Text(
                        "OVERALL RATING OF PATIENT’S ABILITY TO PARTICIPATE AND BENEFIT FROM TREATMENT"
                    )
                    .Bold()
                    .FontSize(11)
                    .Underline();
                table
                    .Cell()
                    .Row(_rowCount)
                    .Column(12)
                    .ColumnSpan(1)
                    .PaddingTop(_padding + 5)
                    .Text("Y    N")
                    .FontSize(11)
                    .Bold()
                    .AlignCenter();

                //body
                for (var i = 0; i < propList.Count; ++i)
                {
                    table
                        .Cell()
                        .Row(++_rowCount)
                        .Column(1)
                        .ColumnSpan(12)
                        .PaddingTop(_padding + 5)
                        .Text(_titles[i]);
                    if (propList[i] == "1")
                    {
                        table
                            .Cell()
                            .Row(_rowCount)
                            .Column(12)
                            .ColumnSpan(1)
                            .PaddingTop(_padding)
                            .AlignRight()
                            .Image(yes);
                    }
                    else
                    {
                        table
                            .Cell()
                            .Row(_rowCount)
                            .Column(12)
                            .ColumnSpan(1)
                            .PaddingTop(_padding)
                            .AlignRight()
                            .Image(no);
                    }
                }
            });
        }

        private List<string> GetProps(EvalProgModel model)
        {
            return new List<string>
            {
                model.RatCognitive ?? "",
                model.RatTreatment ?? "",
                model.RatSocial ?? "",
                model.RatBehave ?? "",
                model.RatPsych ?? "",
                model.RatEmotion ?? "",
                model.RatInterfer ?? "",
                model.RatDeter ?? "",
            };
        }
    }
}
